import React, {Component} from 'react';
import {bindActionCreators} from 'react-redux';
import {connnect} from 'redux';

class GitProfile extends Component{
    constructor(props){
        super(props);
        this.state ={
            userName:''
        }
    }
    render(){
        return(
            <div>
                <label>Git User:</label>
                <br/>
                <input type="text" placeholder='user' value={this.state.userName}/>
                <button>Find</button>
            </div>
        )
    }
}

export default GitProfile;
